import React, {useState} from 'react';
import Modal from 'react-bootstrap/Modal'
import Button from 'react-bootstrap/Button';
import Form from "react-bootstrap/Form";

import "react-datepicker/dist/react-datepicker.css";

const AddNewAccountDialog = (props) => {

    let [firstName, setFirstName,
    lastName, setLastName,
    emailAddress, setEmailAddress,
    dateOfBirth, setDateOfBirth] = useState();

    const handleChangeFistName = e => {
        firstName = e.target.value;
        // setFirstName(e.target.value)
    };

    const handleChangeLastName = e => {
        lastName = e.target.value;
    };

    const handleChangeEmailAddress = e => {
        emailAddress = e.target.value;
    };

    const handleChangeDateOfBirth = e => {
        dateOfBirth = e.target.value;
    };


    const handleSubmit = event => {
        alert(firstName + " " + dateOfBirth);
        event.preventDefault()
    };

    return (
        <Modal
            {...props}
            size="lg"
            aria-labelledby="contained-modal-title-vcenter"
            centered>
            <Modal.Header closeButton>
                <Modal.Title id="contained-modal-title-vcenter">
                    Add New User Account
                </Modal.Title>
            </Modal.Header>
            <Modal.Body>

                <Form onSubmit={handleSubmit}>
                    <Form.Label>First Name</Form.Label>
                    <Form.Control type="text" value={firstName} onChange={handleChangeFistName} />
                    <Form.Label>Last Name</Form.Label>
                    <Form.Control type="text" value={lastName} onChange={handleChangeLastName}/>

                    <Form.Group controlId="formBasicEmail">
                        <Form.Label>Email address</Form.Label>
                        <Form.Control type="email" value={emailAddress} onChange={handleChangeEmailAddress}/>
                    </Form.Group>

                    <Form.Label>Date of Birth</Form.Label>
                    <Form.Control type="date" value={dateOfBirth} onChange={handleChangeDateOfBirth}/>

                    <Button variant="primary" type="submit">
                        Submit
                    </Button>
                </Form>


            </Modal.Body>
            <Modal.Footer>
                <Button onClick={props.onHide}>Close</Button>
            </Modal.Footer>
        </Modal>
    );
};

export default AddNewAccountDialog;
